import React, { useEffect, useState } from 'react';
import axios from 'axios';

const AdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [products, setProducts] = useState([]);
  const [supportTickets, setSupportTickets] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const usersResponse = await axios.get('http://localhost:5000/api/admin/users', {
        headers: { Authorization: localStorage.getItem('token') },
      });
      const productsResponse = await axios.get('http://localhost:5000/api/products');
      const supportResponse = await axios.get('http://localhost:5000/api/support');

      setUsers(usersResponse.data);
      setProducts(productsResponse.data);
      setSupportTickets(supportResponse.data);
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2>Admin Dashboard</h2>
      <h3>Manage Users</h3>
      <ul>
        {users.map(user => (
          <li key={user._id}>{user.name} - {user.role}</li>
        ))}
      </ul>

      <h3>Manage Products</h3>
      <ul>
        {products.map(product => (
          <li key={product._id}>{product.name} - {product.quantity}</li>
        ))}
      </ul>

      <h3>Support Tickets</h3>
      <ul>
        {supportTickets.map(ticket => (
          <li key={ticket._id}>{ticket.question} - {ticket.status}</li>
        ))}
      </ul>
    </div>
  );
};

export default AdminDashboard;
